import React, { useState, useEffect } from 'react';
import { Box, Paper, Typography, Button } from '@mui/material';
import './Bingo.css';

const Bingo = () => {
  const [sortedNumbers, setSortedNumbers] = useState(new Set());
  const [lastFiveNumbers, setLastFiveNumbers] = useState([]);
  const [displayNumber, setDisplayNumber] = useState(null);
  const [gameOver, setGameOver] = useState(false);
  const [showVideo, setShowVideo] = useState(false);

  // Números que desencadenan la visualización del video
  const specialNumbers = [10, 1, 23, 45, 34, 50, 22, 43, 11];

  // Función para generar un número aleatorio
  const generateRandomNumber = () => {
    if (gameOver) return;

    const availableNumbers = [...Array(50).keys()].map(i => i + 1).filter(num => !sortedNumbers.has(num));

    if (availableNumbers.length === 0) {
      setGameOver(true);
      setDisplayNumber(null); // Borra el último número en pantalla
      return;
    }

    const randomIndex = Math.floor(Math.random() * availableNumbers.length);
    const randomNumber = availableNumbers[randomIndex];

    setSortedNumbers(prev => new Set(prev).add(randomNumber));
    setDisplayNumber(randomNumber);

    // Mostrar el video si el número es especial
    setShowVideo(specialNumbers.includes(randomNumber));

    // Actualizar la lista de los últimos cinco números
    setLastFiveNumbers(prev => {
      const updatedList = [randomNumber, ...prev];
      return updatedList.slice(0, 5);
    });
  };

  // Detectar la tecla "Enter" para generar un número aleatorio
  useEffect(() => {
    const handleKeyDown = (e) => {
      if (e.key === 'Enter') {
        generateRandomNumber();
      }
    };
    window.addEventListener('keydown', handleKeyDown);
    return () => {
      window.removeEventListener('keydown', handleKeyDown);
    };
  }, [sortedNumbers, gameOver]);

  // Reiniciar el juego al hacer clic en "Gracias por participar"
  const resetGame = () => {
    setSortedNumbers(new Set());
    setLastFiveNumbers([]);
    setDisplayNumber(null);
    setGameOver(false);
    setShowVideo(false); // Oculta el video al reiniciar
  };

  return (
    <Box
      display="flex"
      flexDirection="column"
      alignItems="center"
      justifyContent="center"
      sx={{ width: '100%', maxWidth: 1280, padding: 3 }}
    >
      {/* Mensaje de agradecimiento al finalizar */}
      {gameOver ? (
        <Paper
          elevation={3}
          onClick={resetGame}
          sx={{
            padding: 3,
            textAlign: 'center',
            cursor: 'pointer',
            backgroundColor: '#ffcc80',
            maxWidth: 400,
            borderRadius: 2,
          }}
        >
          <Typography variant="h4" color="primary">
            Gracias por participar
          </Typography>
        </Paper>
      ) : (
        <>
          {/* Número aleatorio en el centro */}
          <Typography variant="h1" color="secondary" sx={{ mb: 3 }}>
            {displayNumber !== null ? displayNumber : 'Presiona Enter'}
          </Typography>

          {/* Contenedor de video y número sobreexpuesto */}
          {showVideo && (
            <Box position="relative" sx={{ marginTop: 3, maxWidth: 560, width: '100%' }}>
              <iframe
                width="560"
                height="315"
                src="https://www.youtube.com/embed/uBFdSyDkPOU?autoplay=1"
                title="YouTube video player"
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
              ></iframe>
              <Typography
                variant="h2"
                color="error"
                sx={{
                  position: 'absolute',
                  top: '50%',
                  left: '50%',
                  transform: 'translate(-50%, -50%)',
                  textShadow: '2px 2px 10px rgba(0, 0, 0, 0.7)',
                }}
              >
                {displayNumber}
              </Typography>
            </Box>
          )}

          {/* Cartón de Bingo con 5 filas y 10 columnas */}
          <Paper
            elevation={3}
            sx={{
              display: 'grid',
              gridTemplateColumns: 'repeat(10, 1fr)',
              gap: 1,
              padding: 2,
              maxWidth: 700,
              mt: 3,
            }}
          >
            {[...Array(50).keys()].map(i => {
              const number = i + 1;
              const isSorted = sortedNumbers.has(number);

              return (
                <Box
                  key={number}
                  sx={{
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    height: 50,
                    fontSize: 20,
                    fontWeight: 'bold',
                    color: isSorted ? 'white' : 'text.primary',
                    backgroundColor: isSorted ? 'secondary.main' : 'grey.200',
                    borderRadius: 1,
                  }}
                >
                  {number}
                </Box>
              );
            })}
          </Paper>

          {/* Últimos cinco números debajo de la tabla */}
          <Box display="flex" gap={2} mt={3} justifyContent="center">
            {lastFiveNumbers.map((num, index) => (
              <Typography
                key={index}
                variant="h4"
                color="secondary"
              >
                {num}
              </Typography>
            ))}
          </Box>
        </>
      )}
    </Box>
  );
};

export default Bingo;
